This works, but I'm wondering if there's a more elegant or efficient way to handle this, especially if I want to add more variants in the future.

### Updated Solution

To make the component more flexible and maintainable, you can use a more dynamic approach by defining the classes in an object and then selecting the appropriate class based on the `variant` prop. This way, adding new variants in the future will be easier.

Here's an updated version of the `Layout` component:

```jsx
import React from 'react';

const Layout = ({ children, variant = 'centered' }) => {
  const variants = {
    'full-width': 'w-full',
    'centered': 'max-w-screen-lg mx-auto',
    // Add more variants here as needed
  };

  const classes = variants[variant] || variants['centered'];

  return <div className={classes}>{children}</div>;
};

export default Layout;
```

### Explanation:

1. **Default Variant**: The `variant` prop defaults to `'centered'` if not provided.
2. **Variants Object**: An object `variants` is defined where each key corresponds to a variant name and the value is the corresponding Tailwind CSS class.
3. **Dynamic Class Selection**: The `classes` variable is set to the class corresponding to the `variant` prop. If the `variant` prop is not found in the `variants` object, it defaults to the `'centered'` variant.

This approach makes the component more flexible and easier to extend with additional variants in the future.

